import React from 'react';
import { Link } from 'react-router-dom';

const Card = ({ title, image, id }) => {
  return (
    <Link to={`/Fiche-Logement/${id}`} className="card">
      <img src={image} alt={title} />
      <h3>{title}</h3>
    </Link>
  );
};

export default Card;
